sap.ui.define(["victoria/controller/BaseController"],function(e){"use strict";return e.extend("victoria.controller.CollaborationCenter",{onInit:function(){},onValueHelpRequest:function(){this.getMaterialPopup()},onConfirm:function(e){var t=e.getParameter("selectedItem").getLabel();var a=e.getParameter("selectedItem").getValue();this.getView().byId("idMat").setValue(t);this.getView().byId("idMatText").setValue(a);var i=this.getView().getModel("local").getProperty("/collaborationData");i.Material=e.getParameter("selectedItem").getKey();this.getView().getModel("local").getProperty("/collaborationData",i)},onSave:function(){var e=this;e.getView().setBusy(true);var t=this.getView().getModel("local").getProperty("/collaborationData");t.Qty=this.getView().byId("idQty").getValue();t.Weight=this.getView().byId("idWeight").getValue();t.Remarks=this.getView().byId("idrem").getValue();this.ODataHelper.callOData(this.getOwnerComponent().getModel(),"/CollaborationCenters","POST",{},t,this).then(function(t){e.getView().setBusy(false);sap.m.MessageToast.show("Data Saved Successfully")}).catch(function(t){e.getView().setBusy(false);var a=e.getErrorMessage(t)})}})});